CREATE TABLE MEMBER
(
	MEMBER_ID VARCHAR(10) PRIMARY KEY,
	FIRST_NAME VARCHAR(50),
	LAST_NAME VARCHAR(50),
	M_ADDRESS VARCHAR(255),
	BIRTHDAY DATETIME,
	ID VARCHAR(20),
	EMAIL VARCHAR(100),
	PASSWORD VARCHAR(100),
	PHONE_NUM VARCHAR(50)
)





CREATE TABLE STAFF
(
	STAFF_ID VARCHAR(10) PRIMARY KEY,
	FULLNAME VARCHAR(100),
	TITLE VARCHAR(50),
	PHONE_NUM VARCHAR(50),
	M_ADDRESS VARCHAR(255)
)




